import React from "react";
import "./CarCard.css";

const CarCard = ({ image, title, description }) => {
  return (
    <div className="car-card">
      <div className="logo-container">
        <img src={image} alt={title} className="car-logo" />
      </div>
      <h3>{title}</h3>
      <p>{description}</p>
    </div>
  );
};

export default CarCard;
